    _id: '1',
    title: 'article1',
    date_published: ISODate("2014-09-17T23:25:56.314Z"),
    written_by: [{
        _id: '1',
        name: 'Osama'
    }],
    comments: [{
        _id: '1',
        content: 'This is very good article',
        date: ISODate("2014-09-17T23:25:56.314Z"),
