Nesting {{#each}} in Handlebars 304 error<p>My Nested {{#each}} does not work.
I am Scraping article titles to my page and I'm using MongoDB/Mongoose. For each article (that I named News) I want user to post comments and view previous comments.
My routes, console.log, and the database itself shows that my api routes are working, but I can't get  the comments to display.
My handlebars has the articles rendering to screen, but when GETting the comments it returns a 304.</p>

<p>The Articles display as I intend, it only has a problem with the comments
{{#each News}} is each article
{{#each comment}} is nested inside each News.</p>

<pre><code>{{#each News}}
        &lt;div class="panel-block is-active"&gt;
          &lt;ul&gt;
            &lt;li&gt;
              &lt;div class="level-left"&gt;

                &lt;h2  class="subtitle"&gt;
                  &lt;a href="https://www.atptour.com{{this.url}}"&gt;
                  {{this.headline}}
                  &lt;/a&gt;
                &lt;/h2&gt;
              &lt;/div&gt;
            &lt;/li&gt;
            &lt;li&gt;
             &lt;img width="348" src="https://www.atptour.com{{this.thumbNail}}"&gt;

            &lt;/li&gt;
            &lt;li&gt;
             &lt;p&gt;{{category}}&lt;/p&gt;
            &lt;/li&gt;
            &lt;li&gt;
                {{!-- on click remove class .is-hidden on #getComments --}}
              &lt;p id="showComments" data-id="{{this._id}}" &gt;Comments&lt;/p&gt;
            &lt;/li&gt;
            &lt;li&gt;
              {{#each comment}}
              &lt;article id="getComments" class="media is-hidden"&gt;
                &lt;div class="media-content"&gt;
                  &lt;div class="content"&gt;
                    &lt;p&gt;
                      &lt;small&gt;{{this.time}}&lt;/small&gt;
                      &lt;br /&gt;
                      {{this.body}}
                    &lt;/p&gt;
                  &lt;/div&gt;
                &lt;/div&gt;
                &lt;div class="media-right"&gt;
                  &lt;button class="delete"&gt;&lt;/button&gt;
                &lt;/div&gt;
              &lt;/article&gt;
              {{/each}}
              {{!-- on click remove class .is-hidden on #postComments --}}
              &lt;a id="addComment" &gt;Add Comment&lt;/a&gt;
              {{!-- TO POST A COMMENT --}}
              &lt;article id="postComment" class="media is-hidden"&gt;
                &lt;div class="media-content"&gt;
                  &lt;div class="field"&gt;
                    &lt;p class="control"&gt;
                      &lt;textarea
                        class="textarea"
                        placeholder="Add a comment..."
                      &gt;&lt;/textarea&gt;
                    &lt;/p&gt;
                  &lt;/div&gt;
                  &lt;div class="level"&gt;
                    &lt;div class="level-left"&gt;
                      &lt;div class="level-item"&gt;

                        &lt;a class="button is-info"&gt;Submit&lt;/a&gt;
                      &lt;/div&gt;
                    &lt;/div&gt;
                  &lt;/div&gt;
                &lt;/div&gt;
              &lt;/article&gt;
            &lt;/li&gt;
          &lt;/ul&gt;
        &lt;/div&gt;
        {{/each}}
</code></pre>

<p>In the {{#each comment}} {{this.time}} and {{this.body}} is blank. But if I simply put {{this}} I get the _id if each comment. The context must be wrong but I don't know why. The comments are properly associated to the News because I can check the get route and it's all there correctly.</p>

<p>Here are the schemas if it helps</p>

<pre><code>new articles
const NewsSchema = new Schema({
  headline: {
    type: String,
    required: true,
  },
  thumbNail: {
    type: String,
    required: true,
  },
  category: {
    type: String,
    required: true,
  },

  url: {
    type: String,
    required: true,
  },

  // Comments will populate the News
  comment: [
    {
      type: Schema.Types.ObjectId,
      ref: "Comment",
    },
  ],
});
const News = mongoose.model("News", NewsSchema);
</code></pre>

<p>comments</p>

<pre><code>const CommentSchema = new Schema({
  time: {
    type: Date,
    default: Date.now,
    required: true,
  },

  body: {
    type: String,
    required: true,
  },
});
const Comment = mongoose.model("Comment", CommentSchema);
</code></pre>

