i want to fetch courses based on my users query params when they search, so that if somebody asked for sessions from a specific teacher i use that in my $match stage in aggregate if not just find all sessions from all teacher , the same applies for subject and status if they get defined use them if not ignore them and find all possible.</p>

<p>there is another procedure if there was a keyword in mongo or aggregate that i could use and by that it knew that it find all something like * or regex syntax </p>

<p>i also come across to a $cond keyword but did not match my expectations in here .</p>

<pre><code>app.get('/sessions',(req, res)=&gt;{
    const teacher = req.query.teacherId
    const subject = req.query.subjectId
    const status = req.query.statusId

    Course.aggregate([
       if(teacher) {$match:{teacher:teacher}},
       if(subject) {$match:{subject:subject}},
       if(status)  {$match:{status:status}}
    ]).then(sessions=&gt;res.json(sessions))
    .catch(err=&gt;res.json(err))

})
